import requests
import time
import subprocess

base_url = "http://localhost:"

data = {
    "file": "data:image/jpeg;base64,",
    "rotation": ""
}

sudo_password = "123456"
def restart_service(port):
    command = f"sudo -S systemctl restart fr-{port}"
    try:
        process = subprocess.Popen(command, shell=True, stdin=subprocess.PIPE, stdout=subprocess.PIPE, stderr=subprocess.PIPE, universal_newlines=True)
        output, error = process.communicate(input=sudo_password + '\n', timeout=30)
        if process.returncode != 0:
            print(f"Failed to restart service fr-{port}. Error: {error}")
        else:
            print(f"Successfully restarted service fr-{port}. Output: {output}")
    except subprocess.TimeoutExpired:
        print("Timeout occurred while waiting for command to finish")
    except Exception as e:
        print(f"An error occurred: {e}")


for port in range(8001, 8010):
    url = f"{base_url}{port}/verify64"
    start_time = time.time()

    try:
        response = requests.post(url, json=data, timeout=10)
        end_time = time.time()
        response_time = end_time - start_time

        print(f"Port {port}:")
        print("Status Code:", response.status_code)
        print("Response JSON:", response.json())
        print("Response Time:", response_time, "seconds")

        if response_time > 10:
            print(f"Response time for port {port} exceeded 10 seconds. Taking action...")
            restart_service(port)
        print("-----")

    except requests.exceptions.Timeout:
        print(f"Timeout occurred for port {port}. Taking action...")
        restart_service(port)

    except requests.exceptions.RequestException as e:
        print(f"Port {port}: Request failed")
        print("Error:", e)
        print("-----")
